function List(props){
    
    
const category = props.category;
const itemlist = props.item;
    const listitems = itemlist.map(item => <li>key = {item.id}
                                            {item.name}: &nbsp;
                                            <b>{item.calories}</b></li>);
   
    return(
        <>
        <h3 className="list-category">{category}</h3>
        <ol className="list-items">{listitems}</ol>
        </>
    );

}
export default List;
